    "2016-07-27T23:02:53.819844",nt"name": "estuarine-intertidal-and-subtidal-wetland-habitat-types-in-klag-bay-chichagof-island-alask",nt"isopen":
    false,nt"url": null,nt"notes": "Six major estuarine intertidal and subtidal
    wetland habitat types were identified within the inner basin of Klag Bay. These
    habitat types are mapped in Fig. 3. The area of each habitat type and the relative
    percentages of the total area typed are listed in Table 1. A depth-distance cross
    sectional profile showing the distribution of habitat types along Transect 2 is
    given in Figure 4.Although there was no attempt to catalog or make an exhaustive
    survey of all plant and animal species present in each habitat type, the species
    observed or collected during the surveys are listed in Table II. The general description,
    as excerpted from Cowardin et a1 (1), of each habitat type and the site specific
    habitat characteristics observed in Klag Bay are described.",nt"license_title":
